        setApidata(response.data);
        // setLoading(false);
      })
      // .catch((e)=>console.log(e))
    },[])
    return(

      <div className=''>
        {
          apidata && apidata.length>0 && apidata.map((products)=>{
            console.log(products);

            return(
              <>
                <div className='products'>
               <div className='cards'>
               <img src={products.image} alt='image' className='images'></img>
               <p>{products.title}</p>
               <p>{products.price}</p>

               {/* <a href="https://fakestoreapi.com/products/1"><img src={data.image} className='images'></img></a> */}
               </div>
               </div>
              </>
            )
          })
        }
      </div>

    )


}

export default Api;
